import brand10 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/KNM.png';
import brand11 from 'C:/Users/PC/Desktop/Abhi/Cinegraphics-main/frontend/src/assets/brands/Aakruthe.png';
import './Brands.css';

 const Brands = () => {
  return (
    <>
     <div className='brands my-20'>
        <h1 className='brands-heading font-medium font-cairo text-center' >Brands we helped Grow</h1>
