    <div className='mt-10 ml-[8.5em] mr-[8.5em] flex justify-between gap-28 '>
        <img src={brand5} className='h-40 w-auto '/>
        <img src={brand9} className='h-52 w-auto'/>  
        <img src={brand10} className='h-52 w-auto'/>
        <img src={brand11} className='h-52 w-auto'/>
       
    </div>
    </>
   
  )
}

export default Brands;
